window.bookSummaryJSON = "<p>Tamora Pierce brings listeners another Tortall adventure!&nbsp;</p> <p>Alianne is the teenage daughter of the famed Alanna, the first lady knight in Tortall. Young Aly follows in the quieter footsteps of her father, however, delighting in the art of spying. When she is captured and sold as a slave to an exiled royal family in the faraway Copper Islands, it is this skill that makes a difference in a world filled with political intrigue, murderous conspiracy, and warring gods.&nbsp;</p> <p>This is the first of two books featuring Alianne.</p>"; 
